function rgbHex(e){return(e=e.replace(/\s+/g,"")).indexOf("rgb")>=0||e.split(",").length-1==2||e.split(",").length-1==3?normalizeRgb(e):e.indexOf("#")>=0||6==e.length||8==e.length?hexToRgb(e):void 0}function hexToRgb(e){var r="rgb";if((e=e.replace("#","")).match("^[a-fA-F0-9]+$")){e.length/2==3?r+="(":r+="a(";for(var n=0;n<e.length;n+=2){var t=parseInt(e[n]+e[n+1],16);if(isNaN(t))return;r+=t,n<e.length-2?r+=",":r+=")"}return r}}function normalizeRgb(e){if((e=e.replace("rgba","").replace("rgb","").replace("(","").replace(")","")).match("^[0-9,]+$")&&(3==(e=e.split(",")).length||4==e.length)){for(var r=!0,n=0;n<e.length;n++){var t=parseInt(e[n]);if(isNaN(t)){r=!1;break}e[n]=t}if(r)return rgbToHex(e)}}function rgbToHex(e){for(var r="#",n=0;n<e.length;n++){var t=e[n].toString(16);1==t.length&&(r+="0"),r+=t}return r}